⚠️ ATENÇÃO ⚠️
Para evitar possíveis retaliações por parte do ditador que tomou de assalto a Suprema Corte do Brasil, as orientações para quem está participando ou irá participar das manifestações é de irem para as portas dos quartéis. Embora as Forças Armadas tenham se posicionado pela legalidade das manifestações em qualquer parte do território nacional, exceto fechando rodovias ou impedindo o direito de ir e vir, estamos lidando com um ditador que faz uso da ilegalidade e da inconstitucionalidade para perseguir patriotas. Não há garantia de segurança longe dos quartéis. No caso de uma ação truculenta por parte das forças de segurança, não haverá ninguém para socorrer. Permaneçam nas áreas militares. Temos o apoio e a segurança dos militares das Forças Armadas. TODOS NOS QUARTÉIS.

